import React, {Component} from 'react';
import {Button, Header, Container} from 'semantic-ui-react';

class Nav extends Component{
    render(){
        return(
            <div>

                <Container>
                    <Header></Header>
                    <Header sub>Patient's Name</Header>
                </Container>

                <Button color="blue">Edit Information</Button>
            </div>
        );
    }
}

export default Nav;
